import React from "react";

const Portfolio = () => {
  return (
    <>
    <div className='portfolio-container-1'>
      <div className='portfolio-box-1-vid'>
          <h1>Video Test</h1>
      </div>
    </div>

    <div className='portfolio-container-2'>
      <div className='portfolio-box-2-card-1'>
          <h1>Card Test</h1>
      </div>

      <div className='portfolio-box-2-card-2'>
          <h1>Card Test 2</h1>
      </div>
    </div>
    </>
  )
};

export default Portfolio;
